import React from 'react';
import './reset.css'

function Reset() {
  
  function refreshPage() {
    window.location.reload(false);
  }
  
  return (
    <div>
      <button id='rese' onClick={refreshPage}>RESTART GAME</button>
    </div>
  );
}

export default Reset;
